import React from "react";
import { View, Text, StyleSheet } from "react-native";
import { WebView } from "react-native-webview";
import Constants from "expo-constants";

const PriceInner = ({ props, route }) => {
  const [url, setUrl] = React.useState("");

  React.useEffect(() => {
    setUrl(`https://www.daraz.pk/catalog/
    ?spm=a2a0e.searchlistcategory.search.1.4a3284far1W6lV&q=cosmetics&_keyori=ss&from=search_history&sugg=cosmetics_0_1`);
  }, [route]);

  console.log("url", url);

  return (
    <View style={{ flex: 1 }}>
      <WebView
        style={styles.container}
        source={{
          uri: url,
        }}
      />
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: Constants.statusBarHeight,
  },
});

export default PriceInner;
